const TestHeader = () => (
  <>
    <nav class='navBar'>
      <nav class='wrapper'>
        <div class='logo'></div>
        <ul>
          <li>
            <a href='#'>Lorem</a>
          </li>
          <li>
            <a href='#'>Ipsum</a>
          </li>
          <li>
            <a href='#'>Serum</a>
          </li>
        </ul>
      </nav>
    </nav>
    <header class='wrapper'>
      <h1>Big ol' Lorem</h1>
      <p>
        Lorem ipsum dolor sit amet, consectetur adipisicing elit. Debitis, sint
        corporis dolores omnis consectetur quaerat nesciunt beatae maiores,
        itaque labore ex vero pariatur nulla non fugiat, facilis eaque sunt
        doloremque!
      </p>
      <style jsx>{`
        .wrapper {
          margin: 0 auto;
          max-width: 960px;
          padding: 0 2%;
        }
        h1 {
          font-size: 3em;
          padding: 1em 0;
        }

        header {
          padding-top: 75px;
        }
      `}</style>
    </header>
  </>
);

export default TestHeader;
